const milisec_to_date = (date, format) => {
  switch (format) {
    case "yyyy-mm-dd":
      let arrayDate = date.split("-");
      let yyyy_milisec = (arrayDate[0] - 1970) * 31556952000;

      let mm_milisec = arrayDate[1] * 2592000000;
      let dd_milisec = (arrayDate[2] - 1) * 24 * 60 * 60 * 1000;

      let day = new Date(date);

      let dayTime = day.getTime();

      console.log(dayTime, "day");

      console.log(yyyy_milisec + mm_milisec + dd_milisec);
      break;

    default:
      break;
  }
};

export default milisec_to_date;
